import React from 'react';
import { Col, Container, Row } from 'reactstrap';


const Home = () => {
  return (
    <>
      {/* ============ hero section start =========== */}
      <div className='hero-background'>
  <p style={{ color: '#FFF', textAlign: 'center', lineHeight: '80px' }}>Debugging Background</p>
</div>

      <section>
        <Container>
          <Row>
            <Col lg='12'>
            </Col>
          </Row>
        </Container>
      </section>
      {/* ============ hero section end =========== */}

    </>
  );
};


export default Home;



